var museo100 = '';
var museo300 = '';
var museo700 = '';
var gunplay = '';
var museoSans500 = '';

var callAddFont = function () {
    this.addFileToVFS('Museo-700-normal.ttf', museo700);
    this.addFont('Museo-700-normal.ttf', 'Museo-700', 'normal');

    this.addFileToVFS('Museo-300-normal.ttf', museo300);
    this.addFont('Museo-300-normal.ttf', 'Museo-300', 'normal');

    this.addFileToVFS('Museo-100-normal.ttf', museo100);
    this.addFont('Museo-100-normal.ttf', 'Museo-100', 'normal');

    this.addFileToVFS('Museo-Sans-500-normal.ttf', museoSans500);
    this.addFont('Museo-Sans-500-normal.ttf', 'Museo-Sans-500', 'normal');

    this.addFileToVFS('Gunplay-Regular-normal.ttf', gunplay);
    this.addFont('Gunplay-Regular-normal.ttf', 'Gunplay-Regular', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])